import axios from 'axios';
const ACCESS_KEY = 'rkcVhVCZfLEaTGKdJar6pLrHvR9QC9Mn2a6R8Yk7I1g';

const BASE_URL = 'https://api.unsplash.com/photos';
const AUTH_PARAM = `?client_id=${ACCESS_KEY}`

export const getImages = async (page) => {
  try {
    const images = await axios.get(`${BASE_URL}`, { headers: { Authorization: `Client-ID ${ACCESS_KEY}` } });

    return images;
  } catch(err) {
    throw err;
  }
};

export const getImage = async (id) => {
  try {
    const image = await axios.get();
  } catch(err) {
    throw err;
  }
};
